// 云函数入口文件
const cloud = require('wx-server-sdk')

cloud.init()
// 上传的图片是临时素材，会过期，所以得用触发器来调用云函数进行自动更新

// 更新之后的素材会有一个 MEDIA_ID ，把这个写入到云数据库中
// 回复图片的时候就是回复这个 MEDIA_ID
// 云函数入口函数
exports.main = async (event, context) => {
  const fileID = 'cloud://py-b6gxa.7079-py-b6gxa-1259343682/gzh-白色背景.jpg'
  var resfile = await cloud.downloadFile({
    fileID,
  })

  var buffer = resfile.fileContent
  var base64 = 'data:image/jpeg;base64,'
  //var buffer = wx.base64ToArrayBuffer(base64)
  const result = await cloud.openapi.customerServiceMessage.uploadTempMedia({
    type: 'image',
    media: {
      contentType: 'image/jpeg',
      value: buffer,
    }
  })
  console.log(result)
  
}